import React from 'react';
import { Container, Row, Col,Table } from 'react-bootstrap';

const List = () => {
    return(
        <Container md>
            <Row >
                <Col md={8}>
                    <div>USERS DETAILS</div>
                     <Table striped bordered hover size="sm">
                         <thead>
                            <tr>
                                <th>id</th>
                                <th>Firstname</th>
                                <th>Lastname</th>
                                <th>email</th>
                             </tr>
                         </thead>
                      </Table>

                </Col>
            </Row>
        </Container>
    );
}
export default List;
